    <!-- comentaRIO -->
    <script type="text/javascript">
      $(document).ready(function(){
        // containment: [0,0,110,120]
          $(".colombia svg").draggable({containment: [100,120,100,120]});
          $(".departamentos svg").draggable();


          $("#mas").click(function(){
              var tamaño_agregado = 100;
              var tamaño_agregado_imagen = 100;
              var mapa_colombia = $(".colombia svg");
              var mapa_departamentos = $(".departamentos svg");
              var tamaño_imagen = parseInt(mapa_departamentos.attr("width")) + tamaño_agregado_imagen;
              var limites = $(".colombia svg").draggable("option", "containment");

              $(".colombia svg, .departamentos svg").draggable("option", "containment", [(limites[0] - 100), (limites[1] - 100), limites[2], limites[3]]);


              if (tamaño_imagen>1040) {
                 $(".colombia").addClass("oculto");
                 $(".departamentos").removeClass("oculto");
              }
              else{
                $(".colombia").removeClass("oculto");
                $(".departamentos").addClass("oculto");
              }
              mapa_departamentos.attr("width", "" + tamaño_imagen);
              mapa_departamentos.attr("height", "" + tamaño_imagen);
              mapa_colombia.attr("width", "" + tamaño_imagen);
              mapa_colombia.attr("height", "" + tamaño_imagen);

          });

          $("#menos").click(function(){
              var tamaño_agregado = 100;
              var tamaño_agregado_imagen = 100;
              var mapa_colombia = $(".colombia svg");
              var mapa_departamentos = $(".departamentos svg");
              var tamaño_imagen = parseInt(mapa_departamentos.attr("width")) - tamaño_agregado_imagen;


              if (tamaño_imagen>=740) {

                var margen_arriba_mapa = mapa_colombia.css("top");
                var margen_izquierda_mapa = mapa_colombia.css("left");
                mapa_colombia.css("left", parseInt(margen_izquierda_mapa) + 50);
                mapa_colombia.css("top", parseInt(margen_izquierda_mapa) + 50);
                var margen_arriba_mapa_2 = mapa_departamentos.css("top");
                var margen_izquierda_mapa_2 = mapa_departamentos.css("left");
                mapa_departamentos.css("left", parseInt(margen_izquierda_mapa_2) + 50);
                mapa_departamentos.css("top", parseInt(margen_izquierda_mapa_2) + 50);

                if (tamaño_imagen>1040) {

                   $(".colombia").addClass("oculto");
                   $(".departamentos").removeClass("oculto");
                   mapa_colombia.css("left", mapa_departamentos.css("left"));
                   mapa_colombia.css("top", mapa_departamentos.css("top"));
                   mapa_departamentos.css("left", mapa_colombia.css("left"));
                   mapa_departamentos.css("top", mapa_colombia.css("top"));
                }
                else{
                  $(".colombia").removeClass("oculto");
                  $(".departamentos").addClass("oculto");
                }

                mapa_departamentos.attr("width", "" + tamaño_imagen);
                mapa_departamentos.attr("height", "" + tamaño_imagen);
                mapa_colombia.attr("width", "" + tamaño_imagen);
                mapa_colombia.attr("height", "" + tamaño_imagen);
                var limites = $(".colombia svg").draggable("option", "containment");
                $(".colombia svg, .departamentos svg").draggable("option", "containment", [(limites[0] + 100), (limites[1] + 100), limites[2], limites[3]]);
              }
          });


      });
    </script>
